import React, { useState } from 'react';


const FilterOriginElement = (props) => {
    const [selected, setSelected] = useState(false)
    const handleCheckbox = (some) => {
        setSelected(!selected)
    }
    return (
        <div className="originList">
            <label htmlFor="origin" className="originName">
                {props.origin.toUpperCase()}
            </label>
            <input  
                type="checkbox" 
                name={props.origin} 
                className="origin"
                defaultChecked={selected}
                onChange={() => handleCheckbox(console.log(`Origin: ${e.target.name} -- ${selected}`)
                )}   
            />
        </div>
    )
}

export default FilterOriginElement
